(130, 2, 35, 'Vision, Mission', 1, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><span style=\"color:#F0F8FF\"><u>Philosophy, vision, mission</u></span></td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#F0F8FF\">&nbsp; :&nbsp;</span><br />\r\n			&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&ldquo;Quality and virtue&rdquo;</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#F0F8FF\">vision&nbsp; :<br />\r\n			&ldquo;Faculty of Management Science: Quality and Morality Leading in Management and Communication Arts&quot;</span></td>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&ldquo;Faculty of Management Science: Quality and Morality Leading in Management and Communication Arts&quot;</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><span style=\"color:#F0F8FF\">mission&nbsp; :</span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">1. Graduate Business Administration And communication arts to meet the needs of the community And economic society<br />\r\n			Knowledge base with virtue And know how to live happily on the basis of sufficiency<br />\r\n			2. Innovation research And knowledge in business administration and communication to local development As well as the development of Thai wisdom to the world<br />\r\n			3. Provide academic services and transfer technology in business administration and communication to the community<br />\r\n			And quality society To raise the standard of community, society and small and medium enterprises or SME to international<br />\r\n			4. Promote and support the preservation of arts, culture and maintain the nation, religion, monarchy</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
