(10050, 2, 1721, 'Faculty of Management Science Organize a project to develop potential in the simulation business. For new entrepreneurs,2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190424/c8fe6cfbb1c00a793009dd5ba32d8793fe8eeca9.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;On April 19, 2019, the Faculty of Management Science Suan Sunandha Rajabhat University Organized a project to develop potential in the simulation business for new entrepreneurs in the year 2019, which was honored by Assistant Professor Dr. Prateep Vajithongratana, Dean of the Faculty of Management Science As the chairman said the project was opened and visited the simulation business of each branch of students participating in the contest at the activity area under Building 57, Faculty of Management Science.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;The project is intended to be held. To encourage students to have knowledge and understanding About the business process and can apply knowledge to the simulation business Activities include Simulation business contest And organizing exhibition boards for presentations.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
