(10052, 2, 1722, 'Film and digital media organized academic seminar, \"Jab Chai\", join with 5 institutions to screen movies together.', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190424/09fef2d99e0c2b34532e6ab21130e2b90346e2bb.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.322px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; Film and digital media, Communication Arts program, Faculty of Management Science, Suan Sunandha Rajabhat University organized academic seminar, &quot;Jab Chai&quot; 2nd &nbsp;is a project to screen the thesis of 5 students together and talk about the work behind the production of short films. Consisting of Thammasat University Bangkok University Silpakorn University Rangsit University And Suan Sunandha Rajabhat University at Major Cineplex Samsen, Bangkok.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;Creating a network of students from different institutions creates friendships between professional friends. Which has been well received by students under the Including many third parties interested in joining the event This activity is considered as the main activity of film and digital media fields that focus on students to gain knowledge, skills and potential in the profession. Under the program of the Faculty of Management Science.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
