(10062, 2, 1727, 'Faculty of Management Science arranged presents Mini Conference, presenting research of accounting students', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190507/a734e5e1026c5acc99b6ddf5a16a4af674c50858.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:543.609px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; On April 26, 2019, Faculty of Management Science, Suan Sunandha Rajabhat University arranged an academic conference to present research of accounting students honored by Assistant Professor Dr. Prateep Wajeetongratana, Dean of the Faculty of Management Science as the president &nbsp;said the opening ceremony at the Suwaphakniwet &nbsp;Conference Room (5724), Faculty of Management Science.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;The objective of the project is to be a public forum for the dissemination of research and academic works of accounting students. This will lead to an application research of students for further professional and social benefits.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
