(10064, 2, 1728, 'Faculty of Management Science, arrange Mini Conference, presenting scholarly articles of Business Administration students.', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190508/a820dadfaeb9b2c6830731aa1298a77ba61ef514.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;On April 26, 2019, Faculty of Management Science Suan Sunandha Rajabhat University arrange Mini Conference, presenting scholarly articles of Business Administration students for development of student quality in research. In order to comply with the policy of promoting student development to university research. Which dividing the presentation into sub-rooms of each branch.</span></p>\r\n', '', ''),
(10065, 1, 1729, ' .  CSR   .', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190429/98c2711cf853f3c6aa0561de901cda2ee7ca28a9.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;  &nbsp;      3 &nbsp;<br />\r\n   .  <br />\r\n   <br />\r\n &nbsp;EGAT and Sustainable Development &nbsp; .  7  </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;  1   RFID  AVATAR </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; 2   4   </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;  3    </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;  4   </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; 5   .  </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; 6      &nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; 7     </span></p>\r\n', '', ''),
(10066, 2, 1729, 'Public relations students of FMS have studied CSR activity at the EGAT Learning Center.', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190508/d382ca8b9568b62bbd53129d4d2c73299a53a180.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;Recently Assistant Professor Wipanee Manin, Lecturer in Public Relations and Corporate Communication bring the 3rd year students team to study the CSR activity at the Electricity Generating Authority of Thailand (EGAT) Learning Center.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; The students visiting the EGAT Learning Center, divided into 7 learning zones, including ;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;<strong>Zone 1</strong>&nbsp;Sparked the first light in your life . Register for RFID transform into AVATAR. Adventures in the electric power world.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;&nbsp;<strong>Zone 2,</strong>&nbsp;From the first light to the eternal light, &nbsp;4D movie that will take you &nbsp;meet the first day has touched electric power until the day that electricity needs increase.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; Zone 3&nbsp;</strong>Restores balance to life, a future that is balanced between human nature and technology.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\"><strong>&nbsp; &nbsp; &nbsp; Zone 4,</strong>&nbsp;The river of pride Experience the mission of pride for the happiness of Thai people. From the watershed forest to the Chao Phraya River.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\"><strong>&nbsp; &nbsp; &nbsp; &nbsp;Zone 5</strong>&nbsp;Innovation for life explore the history of the future of EGAT and Thai electricity mission in parallel with the world and Thai society. Including learning innovation and technology for the production of power transmission lines.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\"><strong>&nbsp; &nbsp; Zone 6</strong>&nbsp;Sustainable world explore the electrical energy world of countries around the world, including Thailand.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><strong>&nbsp; &nbsp; &nbsp;Zone 7,</strong>&nbsp;Eternal light, processing, learning and combining the power to create the light of eternal happiness.</span></p>\r\n', '', ''),
(10067, 1, 1730, ' .  Lets Get Organized  4.0', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190430/1e467055a0e1ed4082c3f30800d3939c493ccc16.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:549.25px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;    3  Let&rsquo;s Get Organized  How to be PR 4.0      .   &nbsp;   Creative / Project manager    &nbsp;  Content  4.0 &nbsp; Workshop  4.0      </span></p>\r\n', '', ''),
(10068, 2, 1730, 'Public Relations Department, FMS, arranged the Lets Get Organized Project, aimed at the public relations 4.0 era', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190508/32413ebaf4fde1e4de61ec12a33acc973c8a3bab.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:549.25px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">Recently 3rd public relations and communication organization students arranged the Let&rsquo;s Get Organized Project is &nbsp;&ldquo;How to be PR 4.0&rdquo; &nbsp;at Suwaphaknivej Meeting Room. Faculty of Management Science ,Suan Sunandha Rajabhat University by Dr. Nantida Otakum &nbsp;as the speech &nbsp;of the project. Which was honored by Mr. Praphawee &nbsp;Hemmathad, Creative / Project manager, Xderder Company Limited, as a lecturer on the topic of creating content and choosing to use public relations media in the 4.0 era.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;In the afternoon, have a workshop and activity for students who participated in the experiment was a publicist in the 4.0 era, such as the production of public relations media, Learning to be a MC and experimentation as a news announcer and conducting the program. So that participants can bring experience and knowledge from this project for integrating and expanding in the future.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
