(10070, 2, 1731, 'FMS. going on location Samut Songkhram area transfer of knowledge entrepreneurial skills to community business', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190508/52ce10b6c585596ea0b017b60f2949c709ec36c5.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:561.344px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; Research and Academic Services Development Department &nbsp;collaboration with Radio and Television Broadcasting Center , Faculty of Management Science ,Suan Sunandha Rajabhat University organized knowledge transfer project entrepreneurial skills to community business in Bang Khonthi District, Samut Songkhram Province. &nbsp;To transfer of knowledge gained from research for community development increase entrepreneurial skills as well as stepping into business operations in the future In the event, there were villagers, entrepreneurs, led by Mr. Suchol Sukkasem, President of the Sufficiency Economy Learning Center. Participated in the training In the event, there are various techniques that are important in being an entrepreneur. And samples from local products to attend lectures.</span></p>\r\n', '', ''),
