(10105, 1, 1749, '  .   ', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190402/035836464beccc28818352a7c05808bc8b2006ab.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;        &nbsp;  </span></h1>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  .    &nbsp; ACE &ndash; 2019 &nbsp; Actual Economy : European Discourse on Global Challenges  26 &ndash; 28  2562 &nbsp;    &nbsp; &nbsp;   &nbsp;</span></h1>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p>\r\n', '', ''),
(10106, 2, 1749, 'Members of Faculty of Management Science Giving International Academic Presentation in Switzerland', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190419/43f455450caa76d4e4a7a681200bfe54dec76af5.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; During 26 &ndash; 28 March 2019, Faculty of Management Science leading by Prof. Dr. Prateep Wajeetongratana and members of the faculty attended and gave academic presentation at the international conference &ldquo;ACE &ndash; 2019 Actual Economy: European Discourse on Global Challenges&rdquo; in Geneva, Switzerland. It was a great opportunity for faculty members to contribute and exchange knowledge with other foreign researchers. Also, the members could develop themselves in academic perspective.</span></p>\r\n', '', ''),
