(10110, 2, 1751, '\"Rewards Jirat\", a handsome young man in the field of advertising participate in the Icon Siam Fashion Trend 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190419/d932d150a077c6c33382061fd306bf43ed89e616.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:656.8px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;Mr. Jirat Akasuwan (Rewards), Faculty of Management Science students Year 3 Advertising and Marketing Communication, Suan Sunandha Rajabhat University Participate in the Icon Siam Fashion Trend 2019.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;In addition, &quot;Rewards&quot; passed the 13 finalists in the Cuteboy Thailand contest, a reality show to find the first CUTEBOY in Thailand. To step up to become the first Cuteboy in Thailand With the opportunity to enter the entertainment industry as well.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; Follow up and cheer for Rewards in the Cuteboy Thailand program every Sunday at 9:15 pm via True4U and True ID app starting May 5, 2019.</span></p>\r\n', '', ''),
